const prompts = $input.first().json.prompts || [];

const urls = prompts.flatMap(p => p.answer?.links || []);

const cleaned = urls
  .filter(Boolean)
  .map(u => u.trim())
  .filter(u => u.startsWith("http"));

return [{ json: { urls: cleaned } }];

const prompts = $input.first().json.prompts || [];

const qna = prompts
  .filter(p => p.prompt && p.answer?.text)
  .map(p => ({
    question: p.prompt,
    answer: p.answer.text
  }));

return [{ 
  json: { qna } 
}];

