{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "AI QnA Classification Schema",
  "type": "array",
  "items": {
    "type": "object",
    "required": ["id", "question", "category", "confidence"],
    "properties": {
      "id": {
        "type": "integer",
        "minimum": 1,
        "description": "Unique identifier for the question"
      },
      "question": {
        "type": "string",
        "minLength": 1,
        "description": "Original user question or prompt"
      },
      "category": {
        "type": "string",
        "enum": [
          "HOW_TO",
          "DEFINITION",
          "TOOLS",
          "PRICING",
          "COMPARISON",
          "ALTERNATIVES",
          "LEGAL",
          "DECISION",
          "TROUBLESHOOTING",
          "GENERAL"
        ],
        "description": "Zero-shot AI classified intent category"
      },
      "confidence": {
        "type": "number",
        "minimum": 0,
        "maximum": 1,
        "description": "Model confidence score between 0 and 1"
      }
    },
    "additionalProperties": false
  }
}

